            //img\n                imageMessage1: '/images/Message/th1.png',\n                imageMessage2: '/images/Message/th2.png',\n                // Navigation and Common UI Elements\n                home: \"หน้าแรก\",\n                strengths: \"จุดแข็งเรื่องแม่พิมพ์\",\n                about: \"เกี่ยวกับบริษัท\",\n                message: \"สารจากผู้บริหาร\",\n                aboutCompany: \"เกี่ยวกับบริษัทฯ\",\n                companyHistory: \"ประวัติบริษัทฯ\",\n                overseasBranches: \"สาขาในต่างประเทศ\",\n                services: \"บริการของเรา\",\n                recruitment: \"การรับสมัครงาน\",\n                business: \"ธุรกิจของเรา\",\n                dieCasting: \"แม่พิมพ์ฉีดอลูมิเนียม\",\n                machinery: \"เครื่องจักรและอุปกรณ์\",\n                arcana: \"ARCANA\",\n                ecoCylinder: \"บริการ Eco Cylinder\",\n                contact: \"ติดต่อเรา\",\n                faq: \"คำถาม\",\n                welcome: \"ยินดีต้อนรับสู่เว็บไซต์บริษัทของเรา\",\n                language: \"ภาษา\",\n                slogan: \"ก้าวสู่อนาคตด้วยแม่พิมพ์\",\n                tagline: \"สร้างจินตนาการให้เป็นรูปธรรม！ตื่นตัวรับสิ่งที่เกิดขึ้นในอนาคต！\",\n                subTagline: \"บริษัทเรา ไม่เพียงผลิตแม่พิมพ์ที่มีประสิทธิภาพและคุณภาพสูงเท่านั้น ยังมุ่งเน้นการสร้างสรรค์แนวคิดของลูกค้าให้ก่อเกิดเป็นชิ้นงาน และมุ่งสู่อนาคตอย่างเต็มกำลัง\",\n                // Hero Section\n                hero_h1: \"ก้าวสู่อนาคตด้วยแม่พิมพ์\",\n                hero_h2: \"คุณมีสินค้าค้างสต็อกที่ซื้อมา\",\n                hero_h2_sub: \"แต่ไม่ได้ใชักันแล้วอยู่บ้างไหม?\",\n                hero_h3: \"ARCANA（อาร์คาน่า）\",\n                hero_h3_sub: \"อี คอมเมิร์ซยุคใหม่ ที่จะมาพลิกโฉมอุตสาหกรรมการผลิต\",\n                // Section 1\n                sec1H1: \"สร้างจินตนาการให้เป็นรูปธรรม！ ตื่นตัวรับสิ่งที่เกิดขึ้นในอนาคต！\",\n                sec1T1: \"บริษัทเรา ไม่เพียงผลิตแม่พิมพ์ที่มีประสิทธิภาพและคุณภาพสูงเท่านั้น ยังมุ่งเน้นการสร้างสรรค์แนวคิดของลูกค้าให้ก่อเกิดเป็นชิ้นงาน และมุ่งสู่อนาคตอย่างเต็มกำลัง\",\n                sec1b1h1: \"กิจการแม่พิมพ์\",\n                sec1b1h2: \"ARCANA\",\n                sec1b1h3: \"บริการ Eco Cylinder\",\n                sec1b1s1: \"รับออกแบบและผลิตแม่พิมพ์ที่มีประสิทธิภาพ คุณภาพ และความแม่นยำสูง สำหรับชิ้นส่วนยานยนต์และรถจักรยานยนต์เป็นหลัก\",\n                sec1b1s2: \"เราดำเนินการเว็บไซต์อีคอมเมิร์ซ \\\"ARCANA\\\" ที่สามารถซื้อขายผลิตภัณฑ์อุตสาหกรรม และอื่นๆ ได้\",\n                sec1b1s3: \"บริการปรับปรุงและพัฒนาชิ้นส่วนเพื่อให้เป็นมิตรต่อสิ่งแวดล้อม\",\n                sec1H2: \"จุดแข็งของเรา\",\n                sec1T2: \"บริษัทของเรามีความเชี่ยวชาญในการออกแบบและผลิตแม่พิมพ์ฉีดอลูมิเนียมมาตรฐานสากล ด้วยเทคโนโลยีล้ำสมัยและกระบวนการที่เน้นคุณภาพสูงสุด เรามีทีม Design มืออาชีพที่ออกแบบแม่พิมพ์ตามความต้องการ พร้อมแนะนำฟังก์ชันที่เหมาะสม รองรับการผลิตตั้งแต่ 135t ถึง 2550t ด้วยประสบการณ์กว่า 30 ปีและทีมงานผู้เชี่ยวชาญ เรามุ่งมั่นตอบสนองความต้องการและสร้างความพึงพอใจสูงสุดให้กับลูกค้า\",\n                // Section 2\n                sec2b1h1: \"การดำเนินการเพื่อเพิ่มประสิทธิภาพการผลิต\",\n                sec2b1h2: \"การให้คำแนะนำ VA/VE อย่างเต็มที่\",\n                sec2b1h3: \"พร้อมจัดจำหน่ายทั่วโลก\",\n                sec2b1s1: \"เราพร้อมให้ความร่วมมือกับลูกค้า เพื่อเพิ่มประสิทธิภาพการผลิตและพร้อมที่จะตอบสนองความต้องการของลูกค้าทุกท่านไม่ว่าจะเป็น การลดระยะเวลา และลดขั้นตอนในการผลิต รวมถึงการลดการแก้ไขต่างๆ ให้น้อยที่สุด เป็นต้น\",\n                sec2b1s2: \"ด้วยประสบการณ์และผลงานที่ผ่านมามากมายเราพร้อมช่วยแก้ไขปัญหา VA (Value Analysis) และ VE (Value Engineering) ของลูกค้าอย่างเต็มที่\",\n                sec2b1s3: \"ไม่เพียงแค่ในไทย เรายังมีฐานการผลิตอยู่ที่ ญี่ปุ่น และ เม็กซิโก ทำให้เราสามารถตอบรับความต้องการจากลูกค้าทั่วโลกได้ (ประวัติการส่งออก: ญี่ปุ่น สหรัฐอเมริกา ฟิลิปปินส์ เวียดนาม อินเดีย และเม็กซิโก)\",\n                // Section 3 - Recruitment\n                recruitH1: \"แนะนำเกี่ยวกับการรับสมัครงานของ SAMT\",\n                recruits1: \"ตำแหน่งงานที่เปิดรับ\",\n                // Section 4 - Contact\n                contactS1: \"สนใจสอบถามรายละเอียด/ปรึกษางานเกี่ยวกับแม่พิมพ์ โปรดติดต่อ\",\n                contactS2: \"ติดต่อผ่านเว็บไซต์\",\n                contactS3: \"ติดต่อเราผ่านโทรศัพท์\",\n                // About Section\n                sec1a1: \"พัฒนาไม่หยุดยั้ง สร้างอนาคตที่ดีสำหรับทุกคน！\",\n                sec1a2_1: \"เราคือผู้นำการผลิตแม่พิมพ์ฉีดอลูมิเนียมคุณภาพสูงในประเทศไทย ด้วยประสบการณ์กว่า 30 ปี เรามุ่งมั่นพัฒนาและผลิตแม่พิมพ์ที่ตอบโจทย์ทุกความต้องการของลูกค้า ด้วยมาตรฐานที่เน้นประสิทธิภาพและความคุ้มค่า\",\n                sec1a2_2: \"นอกจากนี้ เรายังขยายบริการด้วยธุรกิจใหม่ เช่น ARCANA แพลตฟอร์มที่ช่วยจัดการของค้างสต็อก และบริการซ่อมบำรุง Hydraulic Cylinder หรือ Eco Cylinder ที่ช่วยฟื้นฟูอุปกรณ์ให้ใช้งานได้เหมือนใหม่ พร้อมยืดอายุการใช้งาน\",\n                sec1a2_3: \"เพื่อสนับสนุนลูกค้าในทุกมิติ ด้วยเทคนิคและความเชี่ยวชาญที่สั่งสมมา เราพร้อมเป็นพันธมิตรที่ช่วยสร้างสรรค์ชิ้นงานคุณภาพสูง ตอบสนองทุกความคาดหวังของลูกค้าทุกท่าน\",\n                // Mold Business\n                mold_h1: \"ธุรกิจของเรา\",\n                mold_h2: \"แม่พิมพ์ฉีดอลูมิเนียม\",\n                mold_t2: \"ออกแบบ และ ผลิตแม่พิมพ์ฉีดอลูมิเนียม\",\n                mold_t3: \"บริษัทของเรามุ่งเน้นการออกแบบและผลิตแม่พิมพ์ที่มีคุณภาพสูง สำหรับชิ้นส่วนยานยนต์และรถจักรยานยนต์ ด้วยความสามารถในการผลิตตั้งแต่ 135 ตันถึง 2550 ตัน และมีประสบการณ์ในการส่งออกมากมาย เรามีทีมงานผู้เชี่ยวชาญพร้อมให้คำปรึกษาช่วยแก้ไขปัญหาของลูกค้าด้วยเทคโนโลยีและความสามารถในการเสนอแนะที่ดีเยี่ยม เพื่อตอบโจทย์ความต้องการของลูกค้าและสร้างความพึงพอใจสูงสุด\",\n                mold_t4: \"เรามีการติดตั้งเครื่องจักรและอุปกรณ์ขนาดใหญ่มีประสิทธิภาพสูง ทำให้สามารถจัดการงานที่ต้องใช้ความแม่นยำสูงได้อย่างความรวดเร็วเราสามารถจัดการชิ้นงานตั้งแต่Φ 3 มม. (ความลึก600 มม.) ถึง Φ20 มม. (ความลึก 1000 มม.) และยังสามารถทำรูปทรง SR ส่วนปลายได้\",\n                // Footer and Navigation\n                f_h1: \"หน้าแรก\",\n                f_h2: \"บริการของบริษัท\",\n                f_h3: \"จุดแข็งเรื่องแม่พิมพ์\",\n                f_h4: \"เกี่ยวกับบริษัทฯ\",\n                f_h5: \"สารจากผู้บริหาร\",\n                f_h6: \"เกี่ยวกับบริษัทฯ\",\n                f_h7: \"ประวัติบริษัทฯ\",\n                f_h8: \"สาขาในต่างประเทศ\",\n                f_h9: \"ธุรกิจของเรา\",\n                f_h10: \"แม่พิมพ์ฉีดอลูมิเนียม\",\n                f_h11: \"เครื่องจักรและอุปกรณ์\",\n                f_h12: \"ARCANA\",\n                f_h13: \"บริการ Eco Cylinder\",\n                f_h14: \"ติดต่อเรา\",\n                f_h15: \"คำถามที่พบบ่อย\",\n                arcanaMail: \"ARCANA Mailติดต่อ\",\n                // Product Menu\n                m1: \"แม่พิมพ์ฉีดอลูมิเนียม\",\n                m2: \"เครื่องจักรและอุปกรณ์\",\n                m3: \"ARCANA (อาร์คาน่า)\",\n                m4: \"บริการ Eco Cylinder\",\n                arcana: \"ARCANA (อาคาน่า)\",\n                arcana_: \"สื่อกลางในการซื้อ-ขายสินค้า อุตสาหกรรม เครื่องจักร และสินค้าใหม่ สินค้าที่พึ่งเปิดตัวในราคาย่อมเยา\",\n                // Cylinder Service\n                cy_s1: \"เรามีบริการปรับปรุงและพัฒนากระบอกสูบไฮดรอริกที่จะ ช่วยลดโอกาสที่จะเกิดความเสียหาย ยืดอายุการใช้งาน และดีต่อสิ่งแวดล้อม\",\n                cy_h2: \"กระบอกสูบที่ใช้เริ่มใช้ไม่ดีเหมือนเดิม แต่จะทิ้งก็เสียดาย\",\n                cy_s2_1: \"สำหรับท่านที่กำลังประสบปัญหากระบอกสูบที่ใช้อยู่เริ่มเสื่อมสภาพแล้ว ทางเรามีบริการซ่อมบำรุงกระบอกสูบไฮดรอริกคอยให้บริการ\",\n                cy_s2_2: \"ด้วยการซ่อมบำรุงอย่างมืออาชีพ จะช่วยลดโอกาสความเสียหายและขยายอายุการใช้งานอย่างเห็นผลควรซ่อมบำรุงอยู่เสมอ เพื่อการใช้งานได้อย่างต่อเนื่องและปลอดภัย  เรามีผู้เชี่ยวชาญที่พร้อมช่วยท่านแก้ปัญหาอย่างรวดเร็วและตรงจุด\",\n                cy_s2_3: \"เรามีผู้เชี่ยวชาญที่พร้อมช่วยท่านแก้ปัญหาอย่างรวดเร็วและตรงจุด\",\n                cy_des: \"สนใจการบริการซ่อมแซมกระบอก Hydrolic ติดต่อเราได้\",\n                // Certification\n                cer_h1: \"มาตรฐาน ISO 9001 : 2015 \",\n                cer_s1: \"ใบรับรองระบบจัดการ\",\n                // Locations\n                addr_h1: \"ที่ตั้ง\",\n                fac_bangplee: \"สำนักงานใหญ่ นิคมอุตสาหกรรมบางพลี\",\n                fac_korat: \"สาขา นิคมอุตสาหกรรมนวนครโคราช\",\n                fac_bangplee_addr: \"438 หมู่ 17 ตำบลบางเสาธง อำเภอบางเสาธง จังหวัดสมุทรปราการ 10570 ประเทศไทย\",\n                fac_bangplee_tel: \"เบอร์โทรศัพท์ : 02-706-7800-4 เบอร์โทรสาร : 02-7067805\",\n                fac_korat_addr: \"999/10 หมู่ 1 ถนนมิตรภาพ ตำบลนากลาง อำเภอสูงเนิน จังหวัดนครราชสีมา 30380 ประเทศไทย\",\n                fac_korat_tel: \"เบอร์โทรศัพท์ : 044-009575-7 เบอร์โทรสาร : 044-009-578 \",\n                aboutFac: \"เกี่ยวกับบริษัท\",\n                // Common UI elements\n                cookie: \"เว็บไซต์นี้ใช้คุกกี้เพื่อให้คุณได้รับประสบการณ์ที่ดีที่สุดในการใช้งานเว็บไซต์ของเรา\",\n                accept: \"ยอมรับ\",\n                samt_des: \"SAMT คือผู้ผลิตแม่พิมพ์ชั้นนำในอุตสาหกรรม\",\n                samt: \"SHIPPO ASAHI MOULDS (THAILAND)\",\n                company_des: \"สร้างสภาพแวดล้อมที่ดีในการทำงานเพื่อให้พนักงานทำงานอย่างมีความสุข\",\n                samt_benefit: \"โบนัส/สวัสดิการ SAMT\",\n                samt_benefit_des: \"เพื่อให้พนักงานทำงานอย่างมีความสุข\",\n                // Strengths\n                st_h1: \"เทคโนโลยีผลิตแม่พิมพ์ความแม่นยำสูง\",\n                st_h2: \"กำลังการผลิตแม่พิมพ์ขนาดใหญ่\",\n                st_h3: \"พัฒนาผลิตภัณฑ์ตามยุคตามสมัย\",\n                st_des1: \"ผู้ผลิตชิ้นส่วนรถยนต์รายใหญ่มีความต้องการคุณภาพการผลิตที่แม่นยำเป็นอย่างมาก และเพื่อให้เป็นไปตามข้อกำหนดด้านความแม่นยำ เราจึงผลิตด้วยทักษะและเทคโนโลยีการผลิตแม่พิมพ์ที่ดีที่สุด ที่ได้ทำมาอย่างต่อเนื่องและยาวนาน\",\n                st_des2: \"เรามีการติดตั้งเครื่องจักรและอุปกรณ์ขนาดใหญ่และประสิทธิภาพสูง ทำให้สามารถจัดการงานที่ต้องใช้ความแม่นยำสูงได้อย่างความรวดเร็ว เราสามารถจัดการชิ้นงานตั้งแต่ Φ3 มม. (ความลึก600 มม.) ถึง Φ20 มม. (ความลึก 1000 มม.) และยังสามารถทำรูปทรง SR ส่วนปลายได้ด้วย\",\n                st_des3: \"เรายินดีนำเสนอในส่วนของการผลิตแม่พิมพ์แบบใหม่ด้วยเทคโนโลยีการผลิตแม่พิมพ์ที่เชื่อถือได้ ให้เป็นรูปทรงตามแบบที่ลูกค้าต้องการ เพื่อท้าทายความสามารถของเราต่อไป\",\n                high_quality: \"คุณภาพสูง\",\n                low_price: \"ราคาประหยัด\",\n                ontime: \"ส่งมอบตรงเวลา\",\n                numberOne: \"สู่การเป็นผู้ผลิตแม่พิมพ์ฉีดอลูมิเนียม อันดับ 1 ในแถบเอเชียตะวันออกเฉียงใต้ ด้วยคุณภาพ ราคาประหยัด และส่งมอบตรงเวลา\",\n                // Index and Products\n                index_h1: \"เราจะช่วยให้ธุรกิจของคุณราบรื่นขึ้นและมีประสิทธิภาพมากยิ่งขึ้น\",\n                index_s1: \"ทุกสิ่งที่คุณต้องการในที่เดียวที่ SAMT\",\n                index_des: \"เรา SAMT เป็นผู้ผลิตที่สำคัญ สำหรับการผลิตสินค้าอุตสาหกรรมแม่พิมพ์ฉีดอลูมิเนียม เราออกแบบและผลิต \\\"แม่พิมพ์ฉีดอลูมิเนียม\\\" ที่เป็นส่วนประกอบ ระบบส่งกำลัง และระบบขับเคลื่อน ที่ขาดไม่ได้ สำหรับชิ้นส่วนรถยนต์ ตามความต้องการการผลิตชิ้นส่วนอลูมิเนียมจำนวนมาก เราผลิตแม่พิมพ์หล่ออลูมิเนียม ที่มีประสิทธิภาพและคุณภาพสูงและมีความแม่นยำเป็นอย่างมาก และเราส่งมอบให้กับผู้ผลิตทั่วโลก\",\n                work_des: \"บริษัทของเราผลิตแม่พิมพ์หล่ออลูมิเนียมสำหรับชิ้นส่วนรถยนต์และรถจักรยานยนต์ เป็นการผลิตแม่พิมพ์ฉีดอลูมิเนียมที่สามารถดำเนินการผลิตแบบครบวงจรตั้งแต่การออกแบบไปจนถึงการประกอบแม่พิมพ์ และการทดสอบแม่พิมพ์ (QC) เรามีกำลังการผลิตที่หลากหลายตั้งแต่ระดับ 135 ตัน ถึง 2500 ตัน นอกจากนี้เรายังสามารถผลิตจุดที่ลึกพิเศษและช่องแคบพิเศษ ตามรูปแบบที่ต้องการ เพื่อหล่ออลูมิเนียมออกมาเป็นผลิตภัณฑ์ที่แตกต่าง โดยใช้เครื่องจักรพิเศษและขั้นตอนที่เราออกแบบอย่างละเอียด เพื่อตอบสนองต่อความต้องการที่หลากหลายของลูกค้า เราจึงเป็นที่ยอมรับในฐานะผู้ผลิตแม่พิมพ์ฉีดอลูมิเนียมชั้นนำ\",\n                smc_service: \"SAMT ให้บริการแบบครบวงจร ตั้งแต่การออกแบบไปจนถึงการผลิต\",\n                // Products Section\n                p_h1: \"เราออกแบบ และ ผลิตแม่พิมพ์ฉีดอลูมิเนียม\",\n                p_h2: \"แม่พิมพ์ฉีดอลูมิเนียมคืออะไร?\",\n                p_h3: \"ผลิตภัณฑ์ ของเรา\",\n                p_h4: \"WE PRODUCE MOULD SIZES FROM 135T TO 2550T.\",\n                p_h5: \"เทคโนโลยีการหล่ออลูมิเนียม\",\n                p_h6: \"รายการ อุปกรณ์เครื่องจักร\",\n                p_s1: \"เราจะทำให้ดีที่สุดเพื่อลูกค้าของเรา\",\n                p_s2: \"แม่พิมพ์ฉีดอลูมิเนียม\",\n                p_s3: \"เราขอนำเสนอการผลิตแม่พิมพ์ที่ดีที่สุดให้แก่ลูกค้าทุกท่าน\",\n                p_des2: \"คือ เทคโนโลยีการหล่ออลูมิเนียมที่รองรับอุตสาหกรรมยานยนต์ Die casting เป็นวิธีการหลอมอลูมิเนียมแล้วอัดเข้าในตัวแม่พิมพ์ด้วยความดันสูง เพื่อให้เกิดเป็นชิ้นส่วนอลูมิเนียม โดยเป็นการหล่อขึ้นรูปนั้น \\\"มีความแม่นยำของมิติสูง\\\" \\\"มีความแข็งแรงสูง\\\" \\\"มีความเบาที่เป็นเอกลักษณ์ของอลูมิเนียม\\\" \\\"สามารถรีไซเคิลได้\\\" มีจุดแข็งหลายแบบ การหล่อด้วยจุดแข็งเหล่านี้ เพื่อใช้ในชิ้นส่วนหลักของรถยนต์รวมทั้งเครื่องยนต์อีกด้วย\",\n                p_des4: \"SAMT ได้ทำงานร่วมกับผู้ผลิตชิ้นส่วนยานยนต์ชั้นนำระดับโลก เราผลิตแม่พิมพ์สำหรับ Die casting machine ขนาดตั้งแต่ 135 ตัน ถึง 2500 ตัน\",\n                p_des5: \"เราเป็นโรงงานผลิตแม่พิมพ์ฉีดอลูมิเนียมที่สามารถดำเนินการผลิตแบบครบวงจร ตั้งแต่การออกแบบจนถึงการประกอบแม่พิมพ์ และตรวจสอบผลิตภัณฑ์ (QC) นับตั้งแต่ก่อตั้งในปี 1993 SAMT ได้ผลิตสินค้าให้กับผู้ผลิตชิ้นส่วนรถยนต์ เพื่อตอบสนองความต้องการที่หลากหลายของลูกค้า รวมทั้งเทคโนโลยีการผลิตแม่พิมพ์ได้ที่รับการปลูกฝังมาตั้งแต่เริ่มก่อตั้ง เราจึงขอนำเสนอการผลิตแม่พิมพ์ที่ดีที่สุดให้แก่ลูกค้าทุกท่าน\",\n                photo_list: \"รายการ อุปกรณ์เครื่องจักร\",\n                // ARCANA Section\n                acana_head: \"ARCANA เว็บ\",\n                acana_des: \"มีสินค้าค้างสต็อกอยู่ไหม ARCANA เป็นเว็บไซต์ซื้อ-ขายสินค้าค้างสต็อกและสินค้าอื่นๆ อีกมากมาย สามารถขายชิ้นส่วนอะไหล่ที่ไม่ต้องการได้ และผู้ซื้อสามารถซื้อสินค้าได้ - ในราคาที่ถูก อีกทั้งยังมีสินค้าหมวดอื่นๆ ที่ท่านสามารถนำมาฝากขายกับเราได้ หากสนใจฝากขาย-ซื้อสินค้ากับเรา\",\n                acana_h1: \"ARCANAคือ？\",\n                acana_h2: \"ประเภทสินค้าใน ARCANA\",\n                acana_h3: \"ที่มาของชื่อ ARCANA\",\n                acana_h4: \"สำหรับ ผู้สนใจร่วมลงขายกับเรา\",\n                acana_h5: \"สำหรับ ผู้กำลังมองหาสินค้า\",\n                acana_h6: \"ขอบเขตของสินค้าที่สามารถลงขายกับเราได้\",\n                acana_des1: \"ARCANA คือ พื้นที่สื่อกลางในการซื้อขายสินค้า เราสามารถช่วยให้ท่านหาสินค้าเพื่อลดค่าใช้จ่าย หรือ ช่วยท่านในการเพิ่มรายได้จากการขายสินค้า dead stock ของท่าน  มาเพิ่มมูลค่าให้สินค้าค้างสต็อกกันเถอะ\",\n                acana_des2: \"・สินค้าใหม่ หรือ สินค้าพึ่งเปิดตัวได้ไม่นาน・สินค้าเดดสต็อก หรือสินค้าค้างสต็อกที่ไม่เคยผ่านการใช้งาน แต่ถูกเก็บไว้เป็นเวลานาน\",\n                acana_des3: \"ชื่อArcanaนั้นมาจากคำภาษาญี่ปุ่นที่ว่า \\\"Arukana?\\\" ซึ่งมีความหมายในภาษาไทยว่า \\\"มีหรือเปล่านะ?\\\" โดยเรามุ่งหวังว่าให้ลูกค้าทุกท่านพบเจอสินค้าที่ต้องการในเว็บไซต์ของเรา　และพึ่งพอใจในบริการของบริษัทอย่างสูงสุดจึงได้สร้างเว็บไซต์นี้ขึ้นมา\",\n                acana_des4: \"หาก ท่านสนใจอยากฝากขายกับเราทางเราพร้อมให้บริการส่งต่อสินค้าของท่านสู่มือลูกค้า\",\n                acana_des5: \"หาก ท่านกำลังมองหาสินค้าคุณภาพดี ราคาโดนใจ ท่านสามารถเข้ามาลองเลือกสรรสินค้ากับ ARCANA ก่อนได้ เราพร้อมให้บริการทุกท่าน  หากไม่พบสินค้าดังกล่าวท่านสามารถส่งคำขอหรือติดต่อเราเพิ่มเติมได้ เราพร้อมให้บริการเพื่อส่งมอบสิ่งที่ดีสู่มือของลูกค้าทุกท่าน\",\n                acana_des6: \"✔️สินค้าในอุตสาหกรรมการผลิต/เครื่องจักรที่สามารถขนส่งได้✔️สินค้าที่ไม่เคยผ่านการใช้งานและอยากส่งต่อ✔️สินค้าคุณภาพที่ยังไม่เป็นที่รู้จัก\",\n                arcana_sub: \"ARCANA คือ แพลตฟอร์มที่จะช่วยเพิ่มโอกาสทางธุรกิจ และสามารถช่วยในการหาลูกค้าใหม่ รวมถึงช่วยในการจัดการกับสินค้าค้างสต็อก โดยสามารถขายสินค้าใหม่และสินค้าที่ค้างสต็อกให้กับกลุ่มลูกค้าที่กว้างขึ้นได้ \",\n                // ARCANA Marketing Content\n                arcana_h1: \"คุณกำลังเจอปัญหาเหล่านี้อยู่ไหม?\",\n                arcana_t1: \"สร้างธุรกิจขึ้นมาใหม่ แต่ยังขาดพาร์ทเนอร์ในการขาย\",\n                arcana_t2: \"ผลิตสินค้าใหม่มา แต่ไม่ตรงกับกลุ่มลูกค้าที่มีอยู่เดิม\",\n                arcana_t3: \"มีสินค้าค้างสต็อกที่ไม่ได้ใช้งานอยู่มาก\",\n                arcana_h2: \"ให้ ARCANA ช่